import React from "react";
import RoomDetailItem from "./RoomDetailItem";

function RoomDetail() {
  return (
    <div className="rooms__detail__container">
      <div className="rooms__detail__wrapper">
        <div className="rooms__derail__items">
          <RoomDetailItem img="https://a0.muscache.com/im/pictures/67c84d14-4cd7-4bda-890d-a53fa4b8b113.jpg?aki_policy=large" />
        </div>
      </div>
    </div>
  );
}

export default RoomDetail;
